import React from 'react';
import { Link } from 'react-router-dom';

function JobSeekers() {
  return (
    <div>
      <h1>Job Seekers</h1>
      <Link to="/profile">Create/Edit Profile</Link>
      <Link to="/job-search">Search Jobs</Link>
    </div>
  );
}

export default JobSeekers;
